import {useEffect, useState} from "react";
import axios from "axios";

function App(){
    const[Name, setName] = useState("fojle");
    useEffect( () =>{
        const fetchName = async() =>{
            const res = await axios.get("https://localhost:5000/students");
            setName(res.data);
        }
        fetchName();
    }, []);
    console.log(Name)
    return <div>
        <h1>Hello!</h1>
        <h1>{Name}</h1>
    </div> 
}

export default App;
